Movistar Revistas te da acceso a las mejores revistas de noticias, espectáculos, deportes, mujer, interés general, todo eso en 6 países de Latinoamérica! Leer tus revistas favoritas cuando quieras donde quieras! Es tan fácil desde tu celular, tablet o computador, todo en forma exclusiva para los clientes móviles Movistar.

La aplicación te permitirá:

- Acceder a la app desde distintos países: Argentina, Chile, Costa Rica, Ecuador, Nicaragua y Uruguay;
- Guardar las revistas descargadas para poder verlas en mismo sin conexión a la Internet.
- Escuchar artículos;
- Marcar revistas favoritas;
- Marcar paginas;
- Podrás acceder vía red de datos 3G, 4G y Wi-Fi.

( * ) La app Movistar Revistas requiere acceso a datos o red Wi-Fi. Esto no está incluido en el servicio.
